    },
    {
      title: "Name_ru",
      witdh: "5%",
      dataIndex: "name_ru",
    },

    {
      title: "Edit",
      witdh: "5%",
      render: (fueldata) => {
        return (
          <div>
            <Button
              onClick={() => postoyna11(fueldata)}
              style={{ background: "orange", color: "white" }}
              type="button"
            >
              O'zgartirish
            </Button>
          </div>
        );
      },
    },
    {
      title: "Delet",
      witdh: "5%",
      render: (key) => {
        return (
          <div>
            <Button onClick={() => deletee(key.id)} type="danger">
              O'chirish
            </Button>
          </div>
        );
      },
    },
  ];

  useEffect(() => {
    axios
      .get(`${url}/api/fuel_sort/`)
      .then((res) => {
        setfueldata(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  function deletee(id) {
    axios
      .delete(`${url}/api/fuel_sort/${id}/`, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        axios
          .get(`${url}/api/fuel_sort/`)
          .then((res) => {
            setfueldata(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
        console.log(err);
      });
  }

  function getPost1() {
    var formdata1 = new FormData();
    formdata1.append(
      "name_uz",
      document.querySelector("#fuel_sort_post_uz").value
    );
    formdata1.append(
      "name_ru",
      document.querySelector("#fuel_sort_post_ru").value
    );
    axios
      .post(`${url}/api/fuel_sort/ `, formdata1, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".postoyna10").style =
          "position: absolute;display:none;    transition: 1s;";
        axios
          .get(`${url}/api/fuel_sort/`)
          .then((res) => {
            setfueldata(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {});
  }

  function getPut1(id) {
    var formdata2 = new FormData();
    formdata2.append(
      "name_uz",
      document.querySelector("#fuel_sort_put_uz").value
    );
    formdata2.append(
      "name_ru",
      document.querySelector("#fuel_sort_put_ru").value
    );
    axios
      .put(`${url}/api/fuel_sort/${id}/`, formdata2, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".postoyna11").style =
          "position: absolute;display:none;    transition: 1s;";
        axios
          .get(`${url}/api/fuel_sort/`)
          .then((res) => {
            setfueldata(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {});
  }

  function postoyna11(id) {
    setId(id);
